import React from "react";
import { Navbar } from "./Navbar";
import "../common/styles/home.css";
import SimpleImageSlider from "react-simple-image-slider";
import Image1 from "../common/img/1.jpg";

const images = [
  { url: "" },
  { url: {Image1} },
  // { url: "images/3.jpg" },
  // { url: "images/4.jpg" },
  // { url: "images/5.jpg" },
  // { url: "images/6.jpg" },
  // { url: "images/7.jpg" },
];
export const Home = () => {
  return (
    <body>
      <div className="home">
        <Navbar />
        
        <SimpleImageSlider 
        width={896} 
        height={504} images={images} />
      </div>
    </body>
  );
};
